    },
    setup: function(inputs, outputs) {
    },
    run: function(inputs, outputs) {
        if(inputs.startTime) {
            var t = inputs.startTime;
            var d;
            if(t[10] === 'T' && t[t.length-1] === 'Z') {
                d = new Date(t);
            }
            else {
                d = new Date('2001-01-01T' + t + ':00.000Z');
            }

            outputs.hour = d.getUTCHours();
            outputs.minutes = d.getUTCMinutes();
        }
    }
});

